import {useEffect} from "react";

export default function Dashboard(){
    useEffect(() => {
        fetch("http://localhost:8081/users")
            .then(res => res.json())
            .then(data => console.log(data))
            .catch(err => console.log(err))
    }, []);
    return(
        <>
        Hello World;
        </>
    )
}
